import 'whatwg-fetch';
import React from 'react';

import Scheduler from 'devextreme-react/scheduler';

import CustomStore from 'devextreme/data/custom_store';

function getData(_, requestOptions) {
  const PUBLIC_KEY = 'AIzaSyBnNAISIUKe6xdhq1_rjor2rxoI3UlMY7k',
    CALENDAR_ID = 'f7jnetm22dsjc3npc2lu3buvu4@group.calendar.google.com';
  const dataUrl = [ 'https://www.googleapis.com/calendar/v3/calendars/',
    CALENDAR_ID, '/events?key=', PUBLIC_KEY].join('');

  return fetch(dataUrl, requestOptions).then(
    (response) => response.json()
  ).then((data) => data.items);
}

const dataSource = new CustomStore({
  load: (options) => getData(options, { showDeleted: false })
});

const currentDate = new Date(2017, 4, 25);
const views = ['day', 'workWeek', 'month'];

class Calendar extends React.Component {
  render() {
    return (
        <iframe src="https://calendar.google.com/calendar/embed?height=300&amp;wkst=2&amp;bgcolor=%23ffffff&amp;ctz=Europe%2FLondon&amp;src=bW4yZWhiMTMycm9iZW1tdTlqdmliamtjcmNAZ3JvdXAuY2FsZW5kYXIuZ29vZ2xlLmNvbQ&amp;color=%238E24AA&amp;showTitle=0&amp;showNav=1&amp;showDate=1&amp;showPrint=0&amp;showTabs=1&amp;showCalendars=0&amp;showTz=0" style="border-width:0" width="500" height="300" frameborder="0" scrolling="no"></iframe>

    );
  }
}

export default Calendar;
